import * as React from 'react';
import Box from '@mui/material/Box';
import TextField from '@mui/material/TextField';
import Button from '@mui/material/Button';
import { useState, useEffect } from "react";

export default function FormField() {

  const initialValues = { cname: "", email: "", phone_no: "" };
  const [formValues, setFormValues] = useState(initialValues);
  const [formErrors, setFormErrors] = useState({});
  const [isSubmit, setIsSubmit] = useState(false);

  const handleChange = (e) => {
    const { name, value } = e.target;
    setFormValues({ ...formValues, [name]: value });
  };

  const handleSubmit = (e) => {
    e.preventDefault();
    setFormErrors(validate(formValues));
    setIsSubmit(true);
  };

  useEffect(() => {
    console.log(formErrors);
    if (Object.keys(formErrors).length === 0 && isSubmit) {
      console.log(formValues);
    }
  }, [formErrors]);
  const validate = (values) => {
    const errors = {};
    const email_regex = /^[a-zA-Z0-9.!#$%&'*+/=?^_`{|}~-]+@[a-zA-Z0-9-]+(?:\.[a-zA-Z0-9-]+)*$/;
    const number_regex= /^[+]*[(]{0,1}[0-9]{1,4}[)]{0,1}[-\s\./0-9]*$/;
    if (!values.cname) {
      errors.company_name = "Company Name is required!";
    }
    if (!values.email) {
      errors.email = "Email is required!";
    } else if (!email_regex.test(values.email)) {
      errors.email = "This is not a valid email format!";
    }
    if (!values.phone_no) {
      errors.phone_no = "Phone Number is required!";
    } else if (!number_regex.test(values.phone_no)) {
      errors.phone_no = "This is not a valid Phone Number format!";
    }
    return errors;
  };


  return (
    <Box
      component="form"
      sx={{
        '& .MuiTextField-root': { m: 1, width: '25ch' },
      }}
      noValidate
      autoComplete="off"

    >
      {Object.keys(formErrors).length === 0 && isSubmit ? (
        <div className="ui message success">ValueInput Successful</div>
      ) : (
        <pre>{JSON.stringify(formValues, undefined, 2)}</pre>
      )}

       <form onSubmit={handleSubmit}>

        <div
         style={{   display: "flex",
         flexDirection: 'row',
             justifyContent: "center",
             alignItems: "center",
             justifycontent: "space-between"

          }}
        > 

        <div>
        <h3>Invoice Form</h3>

      <div>

        <TextField
          required
          id="outlined-required"
          label="Company Name"
          name="cname"
              placeholder="Company name"
              value={formValues.company_name}
              onChange={handleChange}

        />

      </div>
      <div>
        <TextField
          required
          id="outlined-required"
          label="Company Email"
          name="email"
              placeholder="Company Email"
              value={formValues.email}
              onChange={handleChange}

        />


      </div>
      <p>{formErrors.email}</p>
      <div>
        <TextField
          required
          id="outlined-required"
          label="Company Phone No"
          name="phone_no"
              placeholder="Company Phone No"
              value={formValues.phone_no}
              onChange={handleChange}

        />

      </div>
      <div>
        <TextField
          required
          id="outlined-required"
          label="Company Address"


        />

      </div>
      </div>
      <div>
        <h3>Client Company Informations</h3>

      <div>
        <TextField
          required
          id="outlined-required"
          label="Client Company Name"
          name="cname"
              placeholder="Client Company Name"
              value={formValues.cname}
              onChange={handleChange}

        />

      </div>
      <div>
        <TextField
          required
          id="outlined-required"
          label="Client Company Email"

        />

      </div>
      <div>
        <TextField
          required
          id="outlined-required"
          label="Client Company Phone No"

        />

      </div>
      <div>
        <TextField
          required
          id="outlined-required"
          label="Client Company Address"

        />

      </div>
      </div>
      </div>
      <br/>
      <div    style={{   display: "flex",

         justifyContent: "center",
         alignItems: "center",
         justifycontent: "space-between"

      }}>
      <button className="fluid ui button blue">Submit</button>
        </div>

    <br/>
    <br/>
    </form>
    </Box>

  );
}
